"In short: Yes.

"In more length: the term ''HTML5'' is widely used as a buzzword to refer to modern web technologies, many of which (though by no means all) are developed at the WHATWG. This document is one such; others are available from the WHATWG Standards overview."', '2025-09-13', '3'), ('52', '16', '5 (2017)', 'https://www.w3.org/TR/2021/SPSD-html52-20210128/', null, '2021-01-28', '2'), ('53', '16', '4 (1999)', 'https://www.w3.org/TR/html40/', null, '1999-12-24', '1'), ('54', '24', 'Level 3', 'https://www.w3.org/TR/2025/NOTE-css-2025-20250909/', '"CSS Level 3" as a term is used only to differentiate it from the previous monolithic versions.', '2025-09-09', '3'), ('55', '24', 'Level 2', 'https://www.w3.org/TR/2008/REC-CSS2-20080411/', 'Although the CSS2 specification is technically a W3C Recommendation, it passed into the Recommendation stage before the W3C had defined the Candidate Recommendation stage. Over time implementation experience and further review has brought to light many problems in the CSS2 specification, so instead of expanding an already unwieldy errata list, the CSS Working Group chose to define CSS Level 2 Revision 1 (CSS2.1). In case of any conflict between the two specs CSS2.1 contains the definitive definition.

Once CSS2.1 became Candidate Recommendation—effectively though not officially the same level of stability as CSS2—obsoleted the CSS2 Recommendation. Features in CSS2 that were dropped from CSS2.1 should be considered to be at the Candidate Recommendation stage, but note that many of these have been or will be pulled into a CSS Level 3 working draft, in which case that specification will, once it reaches CR, obsolete the definitions in CSS2.

